import './App.css';
import Header from './Header';
import About from './About';
import Category from './Category';
import Home from './Home';
import Footer from './Footer';

function App() {
  return (
    <>
      <Header />
      <About />
      <Category />
      <Home />
      <Footer />
    </>
  );
}

export default App;
